    /** <p>In linguistics, a light verb is a verb participating in complex predication 
     *  that has little semantic content of its own, but provides through inflection 
     *  some details on the event semantics, such as aspect, mood, or tense. The semantics 
     *  of the compound, as well as its argument structure, are determined by the 
     *  head or primary component of the compound, which may be a verb or noun (V+V 
     *  or V+N compounds). Other names for "light verb" include: vector verb or explicator 
     *  verb, emphasising its role within the compound; or thin verb or semantically 
     *  weak verb, emphasising (as with "light") its lack of semantics. A "semantically 
     *  weak" verb is not to be confused with a "weak verb" as in the Germanic weak 
     *  inflection. Light verbs are similar to auxiliary verbs in some ways. Most 
     *  English light verbs occur in V+N forms sometimes called "stretched verbs": 
     *  for example, take in take a nap, where the primary sense is provided by "nap", 
     *  and "take" is the light verb. The light verbs most common in these constructions 
     *  are also common in phrasal verbs. A verb which is "light" in one context may 
     *  be "heavy" in another: as with "take" in I will take a book to read. Examples 
     *  in other languages include the Yiddish geb in geb a helf (literally give a 
     *  help, "help"); the French faire in faire semblant (lit. make seeming, "pretend"); 
     *  the Hindi nikal paRA (lit. leave fall, "start to leave"); and the bǎ construction 
     *  in Chinese.[1] Some verbs are found in many such expressions; to reuse an 
     *  earlier example, take is found in take a nap, take a shower, take a sip, take 
     *  a bow, take turns, and so on. Light verbs are extremely common in Indo-Iranian 
     *  languages, Japanese, and other languages in which verb compounding is a primary 
     *  mechanism for marking aspectual distinctions. (http://en.wikipedia.org/wiki/Light_verb)</p>
     */
    public static final Resource LightVerb = m_model.createResource( "http://purl.org/olia/olia.owl#LightVerb" );
    
